import React from 'react';
import classes from './Login.css';

const Login = (props) => {



    return (
        <div className={Login}>
            <div>
                <h1>Авторизация</h1>

                <form className={classes.LoginForm}>
                    <input type="text" />
                    <input type="text" />
                    <button type="success">Войти</button>
                    <button type="primary">Регистрация</button>
                </form>
            </div>
        </div>
    )
}

export default Login;
